    /* forward */
    phi_f = sc[1]*sc[16];
    k_f = 1.0000000000000002e-06 * 1090000000000
                * exp(0.47999999999999998 * tc[0] - 0.50321666580471969 * (-260) * invT);
    dlnkfdT = 0.47999999999999998 * invT + 0.50321666580471969 *  -260  * invT2;
